import './App.css';
import {Route, Routes} from "react-router-dom";
import {PageNotFound, Test} from "./pages";

function App() {
  return (
      <BrowserRouter>


            {/*<Routes>*/}
          <Routes>
              <Route path="/test" element={Test} />
              <Route path="*" element={PageNotFound} />

          </Routes>

            {/*</Routes>*/}
      </BrowserRouter>

  );
}

export default App;
